import logo from './logo.svg';
import './App.css';
import { useEffect } from 'react';

function App() {

  useEffect(() => {
    try {
      const call = async () => fetch("/api");
      call()
      .then(res => res.json())
      .then(data => console.log(data))
    } catch(err) {
      console.error(err)
    }

  }, [])
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        {/* display users here */}
      </header>
    </div>
  );
}

export default App;
